description:
Leonor is a high-class prostitute, and John is her pimp. But often the girl finds customers alone, without giving him a percentage. One day, Leonor knows Paul falls in love with her. Dorothy, wife of Paul, tries in every way to remove him from Leonor, but without success. Meanwhile John, tired of not being able to control also his popular escort, decides to take revenge, and with the help of a couple of friends makes sure that the police incriminate her for a jewelery heist. Detective Ryan finds out ...

